css:
.github-RecentCommits {
  max-height: 105px;
  overflow-x: hidden;
  overflow-y: auto;
  border-top: 1px solid #1c1c38;
}
.github-RecentCommits-list {
  margin: 0;
  padding: 7px 0;
  list-style: none;
}
.github-RecentCommits-message {
  padding: 7px 14px;
  text-align: center;
  color: #808080;
}
.github-RecentCommit {
  position: relative;
  display: flex;
  align-items: center;
  padding: 0 14px;
  line-height: 30px;
}
.github-RecentCommit-authors {
  position: absolute;
  display: flex;
}
.github-RecentCommit-avatar {
  position: relative;
  margin-right: -13px;
  width: 16px;
  height: 16px;
  border-radius: 2px;
  color: transparent;
  background-color: #262839;
  box-shadow: 1px 0 #0f1125;
  overflow: hidden;
  transition: margin 0.12s cubic-bezier(0.5, 0.1, 0, 1);
}
.github-RecentCommit-avatar:nth-child(1) {
  z-index: 3;
}
.github-RecentCommit-avatar:nth-child(2) {
  z-index: 2;
  opacity: .7;
}
.github-RecentCommit-avatar:nth-child(3) {
  z-index: 1;
  opacity: .4;
}
.github-RecentCommit-avatar:nth-child(n+4) {
  display: none;
}
.github-RecentCommit-avatar:only-child,
.github-RecentCommit-avatar:last-child {
  box-shadow: none;
}
.github-RecentCommit-authors:hover .github-RecentCommit-avatar {
  display: inline-block;
  margin-right: 1px;
  opacity: 1;
}
.github-RecentCommit-message {
  flex: 1;
  margin: 0 .5em;
  margin-left: 30px;
  text-overflow: ellipsis;
  white-space: nowrap;
  overflow: hidden;
}
.github-RecentCommit-undoButton.btn {
  padding: 0 9.33333333px;
  margin-right: 7px;
  height: 20px;
  line-height: 1;
  font-size: .9em;
}
.github-RecentCommit-time {
  color: #808080;
}
.github-RecentCommit:hover {
  color: #f0f0f0;
  background: #161937;
}
.github-RecentCommit.is-selected {
  color: #759deb;
  background: #1e2249;
}
.github-RecentCommits:focus .github-RecentCommit.is-selected {
  color: #ffffff;
  background: #2f3675;
}
@media (min-height: 900px) {
  .github-RecentCommits {
    max-height: 165px;
  }
}
@media (min-height: 1200px) {
  .github-RecentCommits {
    max-height: 315px;
  }
}
